import React from 'react'
import classes from './NewProduct.module.css'
import { connect } from 'react-redux'
import HeaderNewProduct from './HeaderNewProduct/HeaderNewProduct'
import Product from './Product/Product'


const NewProduct = (props) =>{
	const arr = []
	let activePage = 1
	const length = 6
	return <section className={classes.section}>
		<HeaderNewProduct text="New Products"/>
		<div className={classes.Products}>
			{arr = props.NewProducts.map(el => { return <Product img={el.img} Prise={el.Prise} Sale={el.Sale} text={el.text} key={el.id}/>})}
			{arr.filter(Product => Product.length > 6)}
		</div>
		<HeaderNewProduct text="Top Products"/>
		<div className={classes.Products}>
			{props.NewProducts.map(el => { return <Product img={el.img} Prise={el.Prise} Sale={el.Sale} text={el.text} key={el.id}/>})}
		</div>
		<HeaderNewProduct text="Sale Products"/>
		<div className={classes.Products}>
			{props.NewProducts.map(el => { return <Product img={el.img} Prise={el.Prise} Sale={el.Sale} text={el.text} key={el.id}/>})}
		</div>
	</section>
}

const mapStateToProps = (state) => {
    return{
    	NewProducts:state.Products.NewProducts,
        activeSlide:state.Slide.activeSlide
    }
}


export default connect(mapStateToProps,{})(NewProduct)
